Properly typing MongoDB specific collection methods which are currently just falling back to "any"<p>In my app I do some work on Mongo collection method's responses and would like to make things easier by typing them, but can't seem to find how to do it.</p>
<p>One of the cases in  point is <code>deleteMany</code>. According to the <a href="https://www.mongodb.com/docs/manual/reference/method/db.collection.deleteMany/#delete-multiple-documents" rel="nofollow noreferrer">docs</a>, the response should be</p>
<pre><code>{ &quot;acknowledged&quot; : true, &quot;deletedCount&quot; : X }
</code></pre>
<p>Is there not a type somewhere for this? Or do I need to manually type it on  my end?</p>
<p>This has unfortunately caused a problem when upgrading form an older version of mongo to v6 since the response no longer contained <code>ok</code>. It would be nice to have a type from Mongo that would've shown a TS error whenever the property no longer existed.</p>
<p>The code looks something like this:</p>
<pre><code>const res = await this.deleteMany(query)  // res is currently an any type


if (res.deletedCount &gt; 10) {
  // do something 
} else {
 // do something else
}
</code></pre>
<p>The issue with that is that <code>res</code> is typed as <code>any</code>. And I would like to know if indeed I need to construct my own type or I can import it from somewhere in case changes are made in  the later version.</p>
<p>Thanks</p>

