Kotlin instantiate open class with primary construction<p>I have a simple scenario in which I have bank accounts from multiple countries. Some information is basic, and each country may have their own particularities. Therefore, I created an open class called <code>DefaultBankAccount</code> and I can have country-specific classes inherit them. However, I am not being able to instantiate a simple <code>DefaultBankAccount</code> object.</p>
<p>When I do, the properties in the constructor are empty:</p>
<pre><code>@Document(collection = &quot;bankAccount&quot;)
open class DefaultBankAccount(
    accountNumber: String,
    address: String,
    bankName: String,
    codeIban: String,
    codeSwift: String,
    country: String,
    holderName: String
) {
    companion object {
        @Transient
        val SEQUENCE_NAME = &quot;payments_sequence&quot;
    }

    @Id
    var id: Long = 0
    var createdAt: LocalDateTime = LocalDateTime.now()
    var updatedAt: LocalDateTime = LocalDateTime.now()
}
</code></pre>
