MongoDB: Using $setWindowFields after $group<p>I have ~30,000 instances, each with a given timestamp and continent.</p>
<p>I'd like to run a query that groups the data by month, returns a count of instances for each defined continent (e.g. &quot;Europe&quot;, &quot;Asia&quot;) per month, and then calculates the cumulative count for each continent.</p>
<p>The query is for a Grafana dashboard so it needs to be an aggregation operation.</p>
<p>At the moment, my query returns the continent count of the given row, rather than a cumulative count of the row and preceding rows.</p>
<p>E.g. If Europe is &quot;10&quot; at time &quot;2020-02-01 0:00:00&quot;, then cumulativeCount will also be &quot;10&quot;, regardless of what came before.</p>
<p>Query:</p>
<pre><code>targets.targets.aggregate([
    {
        $match: {
            &quot;status.isError&quot;: false,
        }
    },
    {
        $group: {
            _id: {
                $dateToString: {
                    format: &quot;%Y-%m-01T00:00:00.000Z&quot;, date: { $toDate: &quot;$date_posted&quot; }
                }
            },
            Europe: {
                $sum: {
                    $cond: [
                        { $eq: [&quot;$continent&quot;, &quot;Europe&quot;] },
                        1,
                        0
                    ]
                }
            }
        }
    },
    {
        $project: {
            _id: 1,
            Europe: 1
        }
    },
    {
        $sort: {
            &quot;_id&quot;: 1
        }
    },
    {
        $addFields: {
            time: { $dateFromString: { dateString: &quot;$_id&quot; } }
        }
    },
    {
        $project: {
            _id: 1,
            time: 1,
            Europe: 1
        }
    },
    {
        $setWindowFields: {
            partitionBy: &quot;$time&quot;,
            sortBy: { &quot;time&quot;: 1 },
            output: {
                cumulativeCount: {
                    $sum: &quot;$Europe&quot;
                }
            }
        }
    }
])
</code></pre>
<p>If I try to $setWindowFields before grouping, the query errors because the sort exceeds the memory limit.</p>

