Mongoose findByIdAndRemove() function doesn't seem to work?<p>When checking the checkbox with a <code>/POST</code> method to the server, it passes the item's <code>ID</code> back to the script.</p>
<p>Then I try to call the <code>findByIdAndRemove()</code> function but it doesn't seem to actually delete the document.</p>
<p>I'm checking with Mongosh (MongoDB new Shell).</p>
<p>NODE:</p>
<pre><code>app.post('/delete', function(req, res){

  const checkedItem = req.body.checked;

  Item.findByIdAndRemove(checked);

});
</code></pre>
<p>EJS:</p>
<pre><code>&lt;% newListItems.forEach(function(item){ %&gt;

      &lt;form action=&quot;/delete&quot; method=&quot;post&quot;&gt;

        &lt;div class=&quot;item&quot;&gt;
          &lt;input type=&quot;checkbox&quot; onChange=&quot;this.form.submit()&quot; name='checked' value='&lt;%= item._id %&gt;'&gt;
          &lt;p&gt; &lt;%=item.name%&gt; &lt;/p&gt;
        &lt;/div&gt;

      &lt;/form&gt;


    &lt;% }); %&gt;
</code></pre>
<p>'Test' should be deleted when checked: <a href="https://i.stack.imgur.com/ujL7Z.png" rel="nofollow noreferrer">https://i.stack.imgur.com/ujL7Z.png</a></p>
<p>But 'Test' is still intact: <a href="https://i.stack.imgur.com/vomkW.png" rel="nofollow noreferrer">https://i.stack.imgur.com/vomkW.png</a></p>
<p>With the most recent Mongoose upgrade to version 7.0, they removed callbacks and some methods stoped working the way they did.</p>
<p>I've tried reading their docs about async and await, using <code>.then</code> and <code>.catch</code> and found no help on the open web since the update is recent.</p>

